import React, { useState } from "react";
import { deleteSupplier } from "../../api";

export default function SupplierDelete({ supplierId, onDeleted }) {
  const [msg, setMsg] = useState("");

  const onClick = async () => {
    try {
      await deleteSupplier(supplierId);
      setMsg("Supplier deleted");
      onDeleted && onDeleted();
    } catch {
      setMsg("Failed to delete supplier");
    }
  };

  return (
    <div>
      <button onClick={onClick}>Delete Supplier</button>
      <div>{msg}</div>
    </div>
  );
}
